import React from "react";
import DropLI from "./DropLI";
import { Select } from "carbon-components-react";
import { SelectItem } from "carbon-components-react";

function DropL(props) {
  return (
    <div style={{ width: "150px", marginLeft: "10px" }}>
      <Select
        invalidText="This is an invalid error message."
        labelText={props.label}
      >
        <SelectItem width="150px" text="TA" value="configGemstul" />
        <DropLI list={props.list} />
        <DropLI list={props.list2} />
        <DropLI list={props.list3} />

        {/* <SelectItem width="150px" text={props.list} value="configGemstul" /> */}
      </Select>
    </div>
  );
}
export default DropL;
